import React, { Component } from 'react';
import * as reactbootstrap from 'react-bootstrap';

class EmployeeListPage extends Component {
    constructor(props) {
        super(props)
        this.state = {
          employeeData: { user: [{
            "id":1,
            "name":"test1",
            "age" : "11",
            "gender":"male",
            "email" : "test1@gmail.com",
            "phoneNo" : "9415346313"
          },
          {
            "id" : 2,
            "name":"test2",
            "age" : "12",
            "gender":"male",
            "email" : "test2@gmail.com",
            "phoneNo" : "9415346314"
          },
          {
            "id":3,
            "name":"test3",
            "age" : "13",
            "gender":"male",
            "email" : "test3@gmail.com",
            "phoneNo" : "9415346315"
          },
          {
            "id":4,
            "name":"test4",
            "age" : "14",
            "gender":"male",
            "email" : "test4@gmail.com",
            "phoneNo" : "9415346316"
          },
          {
            "id":5,
            "name":"test5",
            "age" : "15",
            "gender":"male",
            "email" : "test5@gmail.com",
            "phoneNo" : "9415346317"
          },
          {
            "id":6,
            "name":"test6",
            "age" : "16",
            "gender":"male",
            "email" : "test6@gmail.com",
            "phoneNo" : "9415346318"
          }
        ]},
        }

        this.logOut = this.logOut.bind(this);
    }

    logOut() {
      localStorage.clear();
      window.location.href = '/loginScreen';
    }

    render() {
      const { employeeData } = this.state;
      let users = employeeData.user;

      return (
        <reactbootstrap.Container className="pt-5 px-0">
          <div style={{ color: '#EC661C', fontSize: '14px'}} >
              <span><h4>{'DashBoardPage'}</h4></span>
          </div>
          <reactbootstrap.Form style={{ width: '600px', height: '200px'}}>
            <div>
              <reactbootstrap.Button style={{ float: 'right',backgroundColor: '#EC661C',borderColor: "black",marginBottom: '25px' }} type="button" onClick={e => this.logOut()}>
                    {'LogOut'}
                </reactbootstrap.Button>
            </div>
            <reactbootstrap.Table style={{ display: 'block', border: '2px solid lightgray', height: '200px'}}>
              <thead style={{ backgroundColor: 'black', color: 'white', position: 'sticky', top: '0', textAlign: 'center' }}>
                  <tr style={{ textAlign: 'center', border: '2px solid black' }}>
                    <th>{'Name'}</th>
                    <th>{'Age'}</th>
                    <th>{'Gender'}</th>
                    <th>{'Email'}</th>
                    <th>{'Phone number'}</th>
                  </tr>
                </thead>
                <tbody style={{ backgroundColor: 'black', color: 'white', position: 'sticky', top: '0', textAlign: 'center' }}>
                  {users.length > 0 &&
                    <>
                      {users.map((item) => (
                        <tr style={{ textAlign: 'center', border: '2px solid black' }}>
                           <td>{item.name}</td>
                           <td>{item.age}</td>
                           <td>{item.gender}</td>
                           <td>{item.email}</td>
                           <td>{item.phoneNo}</td>

                        </tr>
                      ))}
                    </>
                  }
                </tbody>
            </reactbootstrap.Table>
          </reactbootstrap.Form>
        </reactbootstrap.Container>
      );
    }
}

export default (EmployeeListPage);
